import React from 'react';
import useGoogleAds from '../../../hooks/useGoogleAds';
import { Chart } from '../../';
import { Table } from "antd";
import './style.scss';

const GoogleAds = () => {
    const {
        costData,
        topCampaignsData,
        topCampaignsImpressionsData,
        campaigns,
    } = useGoogleAds();
    const columns = [
        {
          title: 'Nombre',
          dataIndex: 'nombre',
          key: 'nombre',
        },
        {
          title: 'Impresiones',
          dataIndex: 'impresiones',
          key: 'impresiones',
        },
        {
          title: 'Clics',
          dataIndex: 'clics',
          key: 'clics',
        },
        {
          title: 'Conversiones',
          dataIndex: 'conversiones',
          key: 'conversiones',
        },
        {
          title: 'Costo',
          dataIndex: 'costo',
          key: 'costo',
        },
      ];
    return(
        <div className="analitics-charts-container">
            <div>
                <Chart options={costData}/>
            </div>
            <div>
                <Chart options={topCampaignsData}/>
            </div>
            <div>
                <Table dataSource={campaigns} columns={columns} />;
            </div>
            <div>
                <Chart options={topCampaignsImpressionsData}/>
            </div>
        </div>
    )
}
export default GoogleAds;
